import React from 'react';
import logo from './logo.svg';
import './App.css';
import "./sass/app.scss";

function App() {
  return (
    <div className="app-container">
      <div className="main-container">
        Main Container
        <div className="top-section">Top</div>
        <div className="bottom-section">Bottom</div>
      </div>
    </div>
  );
}

export default App;
